import React from 'react'
import { Link } from 'react-router-dom';
import Logo from '../images/safaricom-connect-logo.png';

import { AppBar, Button, InputBase, makeStyles, Toolbar, Typography } from "@material-ui/core";
import { Person, Search } from "@material-ui/icons";

const useStyles = makeStyles((theme) => ({
    toolbar: {
        display: "flex",
        justifyContent: "start",
    },
    logoSm: {
        display: "inline-block",
        [theme.breakpoints.up("sm")]:{
            display: "none",
        }
    },
    logoLg: {
        display: "none",
        [theme.breakpoints.up("sm")]:{
            display: "inline-block",
        }
    },
}));

function Navbar() {
    const classes = useStyles ();
    return (
        <AppBar>
            <Toolbar classname={classes.toolbar}>
            <Typography variant="h6" component="div" className={classes.logoLg}>Safaricom Connect</Typography>
            <Typography variant="h6" component="div" className={classes.logoSm}>Connect</Typography>
            </Toolbar>
            <div classname={classes.search}>
                <Search />
                <InputBase placeholder="Search..."/>
            </div>
            <div>Icons</div>
        </AppBar>       
    );
};

export default Navbar
